import styled from "styled-components";
import { NavLink as Link } from "react-router-dom";
import { FaBars } from "react-icons/fa";
import marview_logo from "../../imgs/marview_logo.png";

export const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 60px;
  padding: 0 1rem;
  background-color: #fff;
  z-index: 999;
`;

export const Logo = styled(Link)`
  display: flex;
  align-items: center;
  text-decoration: none;
  font-weight: 700;
  font-size: 1.5rem;
`;

export const LogoImg = styled.img`
  width: 50px;
  height: 50px;
  margin-right: 0.5rem;
`;

export const MenuIcon = styled(FaBars)`
  display: none;

  @media screen and (max-width: 768px) {
    display: block;
    font-size: 1.5rem;
    cursor: pointer;
  }
`;

export const MobileNavMenu = styled.div`
  display: none;

  @media screen and (max-width: 768px) {
    display: flex;
    flex-direction: column;
    position: fixed;
    top: 60px;
    left: 0;
    right: 0;
    bottom: 0;
    padding: 1rem;
    background-color: #fff;
    z-index: 999;
  }
`;

export const MobileNavItem = styled(Link)`
  display: flex;
  justify-content: center;
  align-items: center;
  text-decoration: none;
  height: 10vh;
  cursor: pointer;
  color: #00008b;
  font-size: 1.2rem;
  font-weight: bold;
  &:hover {
    color: #4d4dff;
  }
`;

export const NavItem = styled(Link)`
  color: #00008b;
  text-decoration: none;
  padding: 0 1rem;
  cursor: pointer;
  &.active {
    color: #4d4dff;
  }
  &:hover {
    color: #4d4dff;
  }
`;

export const NavLink = styled(Link)`
  color: #00008b;
  text-decoration: none;
  padding: 0.5rem;
  margin: 0 1rem;
  transition: all 0.3s ease-in-out;

  &:hover {
    color: #4d4dff;
  }

  &.active {
    color: #4d4dff;
    border-bottom: 2px solid #4d4dff;
  }
`;

export const AuthButton = styled.button`
  background-color: transparent;
  color: #4d4dff;
  border: 2px solid #4d4dff;
  border-radius: 50px;
  padding: 0.5rem 1rem;
  font-size: 0.9rem;
  font-weight: 600;
  transition: all 0.3s ease-in-out;
  cursor: pointer;

  &:hover {
    background-color: #4d4dff;
    color: #fff;
  }
`;

export const NavMenu = styled.div`
  display: flex;
  align-items: center;

  @media screen and (max-width: 768px) {
    display: none;
  }
`;

export const NavBtn = styled.div`
  display: flex;
  align-items: center;
`;

export const NavBtnLink = styled(Link)`
  background-color: #4d4dff;
  color: #fff;
  border-radius: 50px;
  padding: 0.5rem 1rem;
  font-size: 0.9rem;
  font-weight: 600;
  transition: all 0.3s ease-in-out;
  text-decoration: none;
  cursor: pointer;

  &:hover {
    background-color: #fff;
    color: #4d4dff;
    border: 2px solid #4d4dff;
  }
`;
